import React from "react";
import Slider from "react-slick";
const photos = ["university1.jpg", "university2.jpg", "university3.jpg"];
const PhotoSlider = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <Slider {...settings}>
      {photos.map((photo, index) => (
        <div key={index}>
          <img src={`/images/${photo}`} alt={`Photo ${index + 1}`} />
        </div>
      ))}
    </Slider>
  );
};

export default PhotoSlider;
